from collections import deque
from typing import List

'''
792. Number of Matching Subsequences

Use a trie to store the string s. For each word in words, check if it is a subsequence of s by searching each character in the trie.
Time complexity: O(N + M * L), where N is the length of string s, M is the number of words, and L is the average length of the words.
Space complexity: O(N) for the trie.

Fails on large inputs due to inefficiency. (41/53 test cases passed).
'''

class TrieItem:
    def __init__(self) -> None:
        self.children = {}

class Trie:
    def __init__(self) -> None:
        self.root = TrieItem()
    
    def insert(self, word: str) -> None:
        curr = self.root
        for c in word:
            if c not in curr.children:
                curr.children[c] = TrieItem()

            curr = curr.children[c]

    def search_char(self, char: str, root:TrieItem | None) -> TrieItem | None:
        queue = deque([root])

        while queue:
            current_node = queue.popleft()
            if char in current_node.children:
                return current_node.children[char]

            # Add all children to the queue for the next level of search
            for child_node in current_node.children.values():
                queue.append(child_node)

        # If the queue is empty and the character was not found
        return None
    
    def is_subsequence(self, word: str):
        curr = self.root
        for c in word:
            curr = self.search_char(c, curr)
            if not curr:
                return False
        
        return True

class Solution:
    def numMatchingSubseq(self, s: str, words: List[str]) -> int:
        trie = Trie()
        trie.insert(s)
        
        count = 0
        for word in words:
            if trie.is_subsequence(word):
                count += 1
            
        return count
    

# Testcases:
solution = Solution()
